import React from 'react' ;
import './Table.css' ;



export class Table extends React.Component {
    render() {
        return (
            <div className = 'MainDiv'>
                <table>
                    <tr>
                        <th>Id</th>
                        <th>Name</th>
                        <th>Age</th>
                        <th>E-mail</th>
                        <th>Address</th>
                    </tr>
                </table>
            </div>
        );
    }
}
